import Notification from "../components/Notification";
const Notifications = () => {
  const messages = ["You have a new job notification!"];
  return (
    <div className="p-5">
      <h2 className="text-2xl font-bold">Notifications</h2>
      {messages.map((msg, index) => <Notification key={index} message={msg} />)}
    </div>
  );
};

export default Notifications;
